import * as React from "react";
import { Link } from "react-router-dom";


const AuthorItem = ({item}) => {
    return (
        <tr>
            <td>
                {item.id}
            </td>
            <td>
                <Link to={`/authors/${item.id}`}>{item.first_name}</Link>
            </td>
            <td>
                {item.last_name}
            </td>
            <td>
                {item.birthday_year}
            </td>
        </tr>
    )
}

const itemList = ({ item }) => {
    return (
        <table>
            <th>
               | id автора
            </th>
            <th>
               | Имя автора
            </th>
            <th>
               | Фамилимя автора
            </th>
            <th>
               | год рождения автора |
            </th>
            {item.map((item) => (<AuthorItem item={item} />))}
        </table>
    )
}




export default itemList
